import React from 'react';
import '../App.css';
import {ContentComponentStyled} from '../styledComponent/ContentComponent-styled';
import {FooterStyled} from '../styledComponent/Footer-styled';
import {TextStyled} from '../styledComponent/TextStyled';
import {Form, Input, Button, Checkbox} from 'antd';
import {LoginStyled} from "./Login-styled";
import {UserStyled} from "./login/User-styled";
import {UserAllStyled} from "./login/UserAll-styled";
import {PasswordStyled} from "./Password/Password-styled";
import {PasswordAllStyled} from "./Password/PasswordAll-styled";
import { ButtonFilledStyled } from '../styledComponent/ButtonFilled-styled';
import { ButtonStyled } from '../styledComponent/Button-styled';


const Login: React.FC = () => (
    <LoginStyled>
        <UserAllStyled>
            <UserStyled valid>
                <TextStyled textSize={20} color={'black'} fontWeight={"bold"}>
                    Username
                </TextStyled>
                <Input/>
            </UserStyled>
        </UserAllStyled>

        <PasswordAllStyled>
            <PasswordStyled valid>
                <TextStyled textSize={20} color={'black'} fontWeight={'bold'}>
                    Password
                </TextStyled>
                <Input/>
            </PasswordStyled>
        </PasswordAllStyled>

        <ButtonFilledStyled width={40}>


            <Checkbox/>
            <TextStyled textSize={17} color={'black'} fontWeight={'bold'}>
                Remember me
            </TextStyled>

            <ButtonStyled>
                Submit
            </ButtonStyled>

        </ButtonFilledStyled>





    </LoginStyled>

)


export default Login;
